'use strict';
import React, { Component, View }  from 'react';
import logo from './logo.svg';
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';
import '../node_modules/bootstrap/dist/js/bootstrap.js';


const data = require('./data.json')

class App extends Component {

  constructor(props) {
    super(props);

    this.state = {
      loading: "bra",
      catVal: [''],
    };
}

componentDidMount() {
  let d = data[1]
  var allvalues = Object.values(d)
  var uniq = [ ...new Set(allvalues) ]
  this.setState({catVal: uniq})
}


  render () {

  const numbers = this.state.catVal
  console.log(numbers)

  let i = 0
  const listItems = numbers.map((number, i) =>
      // Correct! Key should be specified inside the array.
                <div className="card">
                  <div className="card-header">
                    <a className="card-link" data-toggle="collapse" data-parent="#card-530014" href={"#card-element-0"}>{number}</a>
                  </div>
                  <div id={"card-element-0"} className="collapse show">
                    <div className="card-body">
                      {i.value}
                    </div>
                  </div>
  </div>
  );

  return (<div className="container-fluid">
        <div className="row">
          <div className="col-md-12">
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
              <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#bs-example-navbar-collapse-1">
                <span className="navbar-toggler-icon" />
              </button> <a className="navbar-brand" href="#">Rating</a>
              <div className="collapse navbar-collapse" id="bs-example-navbar-collapse-1">
                <ul className="navbar-nav">
                  <li className="nav-item active">
                    <a className="nav-link" href="#">Link <span className="sr-only">(current)</span></a>
                  </li>
                  <li className="nav-item">
                    <a className="nav-link" href="#">Link</a>
                  </li>
                </ul>
                <ul className="navbar-nav ml-md-auto">
                  <li className="nav-item active">
                    <a className="nav-link" href="#">Link <span className="sr-only">(current)</span></a>
                  </li>
                  <li className="nav-item dropdown">
                    <a className="nav-link dropdown-toggle" href="http://example.com" id="navbarDropdownMenuLink" data-toggle="dropdown">Dropdown link</a>
                    <div className="dropdown-menu dropdown-menu-right" aria-labelledby="navbarDropdownMenuLink">
                      <a className="dropdown-item" href="#">Action</a> <a className="dropdown-item" href="#">Another action</a> <a className="dropdown-item" href="#">Something else here</a>
                      <div className="dropdown-divider">
                      </div> <a className="dropdown-item" href="#">Separated link</a>
                    </div>
                  </li>
                </ul>
              </div>
            </nav>
            <div id="card-530014">
{listItems}
            </div>
          </div>
        </div>
      </div>
    )
  }
}


export default App
